import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <br></br>
      <header className="App-header">
        <br></br>
        <img src="https://i.pinimg.com/564x/1d/a8/67/1da867c7840b87abbf76cd71d341905b.jpg"  width="400"
  height="341"/>
        <p>

          <code>Hola</code> Fernandito
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
